      gender: "he",
      city: "toronto",
      age: 18,
      nativeAmerican: false,
      id: 0,
    },
    {
      name: "amitis",
      gender: "she",
      city: "seatle",
      age: 18,
      nativeAmerican: false,
      id: 1,
    },
    {
      name: "joe",
      gender: "he",
      city: "chicago",
      age: 21,
      nativeAmerican: true,
      id: 2,
    },
  ]);

  return (
    <div className="home">
      {persons.map((person) => (
        <div className="showCase" key={person.id}>
          <h1>
            {person.name} with {person.age} years old
          </h1>
          <p>
            {person.gender} livin {person.city}
          </p>
          <p>
            {person.gender}'s native amirican? {nativeAmerican}
          </p>
        </div>
      ))}
    </div>
  );
};

export default Home;
